import './App.css';
import {Route, Routes, useLocation, useNavigate} from 'react-router-dom'
function App() {
  const location = useLocation();
  const navigate = useNavigate();


  return (
    <Routes>
      <Route>
      <div className="App">
      <h1>Henry Videogames</h1>
    </div>
      </Route>
    </Routes>
    
  );
}

export default App;
